import React from 'react';

const Contact = () => (
  <section id="contact" className="py-16 bg-gray-50">
    <div className="max-w-xl mx-auto px-4">
      <h3 className="text-3xl font-bold text-blue-900 mb-6 text-center">Get in Touch</h3>
      <form className="space-y-4">
        <input type="text" placeholder="Your Name" className="w-full p-3 border rounded-lg" />
        <input type="email" placeholder="Your Email" className="w-full p-3 border rounded-lg" />
        <textarea placeholder="Your Message" className="w-full p-3 border rounded-lg h-32"></textarea>
        <button type="submit" className="w-full bg-blue-900 text-white py-3 rounded-lg">Send Message</button>
      </form>
    </div>
  </section>
);
export default Contact;
